EY (SCHED_NAME,TRIGGER_GROUP)  \n    );  \n    -- å­˜å‚¨ä¸å·²è§¦å‘çš„ Trigger ç›¸å…³çš„çŠ¶æ€ä¿¡æ¯ï¼Œä»¥åŠç›¸è” Job çš„æ‰§è¡Œä¿¡æ¯  \n    CREATE TABLE qrtz_fired_triggers   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        ENTRY_ID VARCHAR2(95) NOT NULL,  \n        TRIGGER_NAME VARCHAR2(200) NOT NULL,  \n        TRIGGER_GROUP VARCHAR2(200) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        FIRED_TIME NUMBER(13) NOT NULL,  \n        PRIORITY NUMBER(13) NOT NULL,  \n        STATE VARCHAR2(16) NOT NULL,  \n        JOB_NAME VARCHAR2(200) NULL,  \n        JOB_GROUP VARCHAR2(200) NULL,  \n        IS_NONCONCURRENT VARCHAR2(1) NULL,  \n        REQUESTS_RECOVERY VARCHAR2(1) NULL,  \n        CONSTRAINT QRTZ_FIRED_TRIGGER_PK PRIMARY KEY (SCHED_NAME,ENTRY_ID)  \n    );  \n    -- å­˜å‚¨å°‘é‡çš„æœ‰å…³ Scheduler çš„çŠ¶æ€ä¿¡æ¯ï¼Œå’Œåˆ«çš„ Scheduler å®ä¾‹(å‡å¦‚æ˜¯ç”¨äºä¸€ä¸ªé›†ç¾¤ä¸­)  \n    CREATE TABLE qrtz_scheduler_state   \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        INSTANCE_NAME VARCHAR2(200) NOT NULL,  \n        LAST_CHECKIN_TIME NUMBER(13) NOT NULL,  \n        CHECKIN_INTERVAL NUMBER(13) NOT NULL,  \n        CONSTRAINT QRTZ_SCHEDULER_STATE_PK PRIMARY KEY (SCHED_NAME,INSTANCE_NAME)  \n    );  \n    -- å­˜å‚¨ç¨‹åºçš„æ‚²è§‚é”çš„ä¿¡æ¯(å‡å¦‚ä½¿ç”¨äº†æ‚²è§‚é”)  \n    CREATE TABLE qrtz_locks  \n      (  \n        SCHED_NAME VARCHAR2(120) NOT NULL,  \n        LOCK_NAME  VARCHAR2(40) NOT NULL,   \n        CONSTRAINT QRTZ_LOCKS_PK PRIMARY KEY (SCHED_NAME,LOCK_NAME)  \n    );  \n      \n    create index idx_qrtz_j_req_recovery on qrtz_job_details(SCHED_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_j_grp on qrtz_job_details(SCHED_NAME,JOB_GROUP);  \n      \n    create index idx_qrtz_t_j on qrtz_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_jg on qrtz_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_t_c on qrtz_triggers(SCHED_NAME,CALENDAR_NAME);  \n    create index idx_qrtz_t_g on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_t_state on qrtz_triggers(SCHED_NAME,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_state on qrtz_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_n_g_state on qrtz_triggers(SCHED_NAME,TRIGGER_GROUP,TRIGGER_STATE);  \n    create index idx_qrtz_t_next_fire_time on qrtz_triggers(SCHED_NAME,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st on qrtz_triggers(SCHED_NAME,TRIGGER_STATE,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME);  \n    create index idx_qrtz_t_nft_st_misfire on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_STATE);  \n    create index idx_qrtz_t_nft_st_misfire_grp on qrtz_triggers(SCHED_NAME,MISFIRE_INSTR,NEXT_FIRE_TIME,TRIGGER_GROUP,TRIGGER_STATE);  \n      \n    create index idx_qrtz_ft_trig_inst_name on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME);  \n    create index idx_qrtz_ft_inst_job_req_rcvry on qrtz_fired_triggers(SCHED_NAME,INSTANCE_NAME,REQUESTS_RECOVERY);  \n    create index idx_qrtz_ft_j_g on qrtz_fired_triggers(SCHED_NAME,JOB_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_jg on qrtz_fired_triggers(SCHED_NAME,JOB_GROUP);  \n    create index idx_qrtz_ft_t_g on qrtz_fired_triggers(SCHED_NAME,TRIGGER_NAME,TRIGGER_GROUP);  \n    create index idx_qrtz_ft_tg on qrtz_fired_triggers(SCHED_NAME,TRIGGER_GROUP);  \n```\n###2ã€åˆ›å»ºSimpleTriggerä»»åŠ¡\n![SimpleTriggerä»»åŠ¡](http://img.blog.csdn.net/20170228145913674?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nåˆ›å»ºSimpleTriggerä»»åŠ¡ä¸ç”¨æŒ‡å®šCronè¡¨è¾¾å¼ï¼Œå¯æ ¹æ®é‡å¤ç±»å‹å¡«å†™ç›¸åº”çš„é‡å¤æ¬¡æ•°ä¸é‡å¤é—´éš”ï¼ˆå¯ä»¥ä»»åŠ¡é‡å¤æ¬¡æ•°repeatCountä¸é‡å¤é—´éš”repeatIntervalæ˜¯ä¸ºé‡å¤ç±»å‹æŒ‡å®šå‚æ•°ï¼‰ã€‚\n\n###3ã€åˆ›å»ºCronTriggerä»»åŠ¡\n![CronTriggerä»»åŠ¡](http://img.blog.csdn.net/20170228150302971?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQvanJuMTAxMg==/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/SouthEast)\n\nCronTriggerä»»åŠ¡åˆ™æ˜¯é€šè¿‡Cronè¡¨è¾¾å¼åˆ›å»ºçš„ä»»åŠ¡ï¼Œåªéœ€è¦åœ¨ç•Œé¢é…ç½®å¿…å¡«é€‰é¡¹å’ŒCronè¡¨è¾¾å¼å³å¯ã€‚\n\n###4ã€ä¿®æ”¹ä»»åŠ¡\nç‚¹å‡»ä¿®æ”¹ä»»åŠ¡åï¼Œå¯è¿›å…¥åˆ°ä»»åŠ¡ç¼–è¾‘ç•Œé¢ï¼Œä¿®æ”¹ä»»åŠ¡ç›¸å…³å‚æ•°ï¼ˆä»»åŠ¡åå’Œä»»åŠ¡ç»„ä¸å¯ä¿®æ”¹ï¼‰ã€‚ç³»ç»Ÿä¼šé€šè¿‡rescheduleJobæ–¹æ³•é‡æ–°è°ƒåº¦ã€‚\n\n```\n     // triggerå·²ç»å­˜åœ¨ï¼Œæ›´æ–°ç›¸åº”çš„å®šæ—¶è®¾ç½®\n     TriggerBuilder triggerBuilder = trigger.getTriggerBuilder();\n     trigger = setTriggerParam(job, triggerKey, triggerBuilder, trigger);\n     // æŒ‰æ–°çš„triggeré‡æ–°è®¾ç½®jobæ‰§è¡Œ\n     scheduler.rescheduleJob(triggerKey, trigger);\n```\n\n###5ã€æš‚åœä»»åŠ¡\nç‚¹å‡»æš‚åœä»»åŠ¡ï¼Œä»»åŠ¡å°†æŒ‚èµ·ï¼Œä»»åŠ¡çŠ¶æ€ç”±\"NORMAL\"å˜ä¸ºâ€œPAUSEâ€\n\n```java\n      /**\n     * æš‚åœ\n     */\n    public void pauseJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.pauseJob(jobKey);\n    }\n\n```\n\n###6ã€æ¢å¤ä»»åŠ¡\nç‚¹å‡»å›å¤ä»»åŠ¡ï¼Œä»»åŠ¡å°†å˜ä¸ºå¯æ‰§è¡ŒçŠ¶æ€ï¼Œä»»åŠ¡çŠ¶æ€ç”±\"PAUSE\"å˜ä¸ºâ€œNORMALâ€\n\n```\n  /**\n     * æ¢å¤è¿è¡Œ\n     */\n    public void resumeJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.resumeJob(jobKey);\n    }\n\n```\n\n###7ã€åˆ é™¤ä»»åŠ¡\nä»æ•°æ®åº“ä¸­åˆ é™¤ä»»åŠ¡\n\n```\n    /**\n     * åˆ é™¤\n     */\n    public void deleteJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.deleteJob(jobKey);\n    }\n```\n    \n\n###8ã€ç«‹å³è¿è¡Œä¸€æ¬¡\nç‚¹å‡»â€œç«‹å³è¿è¡Œä¸€æ¬¡â€ï¼Œä»»åŠ¡åˆ™é©¬ä¸Šæ‰§è¡Œä¸€æ¬¡\n```\n    /**\n     * è¿è¡Œä¸€æ¬¡\n     */\n    public void triggerJob(ScheduleJob scheduleJob) throws SchedulerException {\n        Scheduler scheduler = schedulerFactoryBean.getScheduler();\n        JobKey jobKey = JobKey.jobKey(scheduleJob.getJobName(), scheduleJob.getJobGroup());\n        scheduler.triggerJob(jobKey);\n    }\n\n```\n\n\n\n\n','quartz',NULL,NULL,NULL,NULL);
