INSERT INTO `tbl_user_item` VALUES ('402880e55c590053015c593373340007','2017-05-30 19:52:43',0,'2017-05-30 19:52:43',0,NULL,'0','402880e55c590053015c59291f6a0000',20,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      //do something;\r\n      return 2.0;\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880e55c590053015c5934d6410008','2017-05-30 19:54:13',0,'2017-05-30 19:54:13',0,NULL,'1','402880e55c590053015c59291f6a0000',100,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      int len_1=nums1.length;\r\n        int len_2=nums2.length;\r\n        int middle=0;\r\n        boolean isOdd=false;\r\n        if((len_1+len_2)%2==0){\r\n            middle=(len_1+len_2)/2-1;\r\n            isOdd=false;\r\n        }else{\r\n            middle=(len_1+len_2)/2;\r\n            isOdd=true;\r\n        }\r\n        //åˆå¹¶æ’åº\r\n        int[] num=new int[len_1+len_2];\r\n        int i=0,l=0,r=0;\r\n        while(l<len_1&&r<len_2){\r\n            if(nums1[l]<nums2[r]){\r\n                num[i]=nums1[l];\r\n                i++;\r\n                l++;\r\n            }else{\r\n                num[i]=nums2[r];\r\n                i++;\r\n                r++;\r\n            }\r\n        }\r\n        while(l<len_1){\r\n            num[i++]=nums1[l++];\r\n        }\r\n        while(r<len_2){\r\n            num[i++]=nums2[r++];\r\n        }\r\n\r\n        if(!isOdd){\r\n            return (double)(num[middle]+num[middle+1])/2;\r\n        }else{\r\n            return (double)num[middle];\r\n        }\r\n    }\r\n}','402880e456223e8f015625231d8e0003',NULL,NULL),('402880e55c590053015c593769440009','2017-05-30 19:57:02',0,'2017-05-30 19:57:02',0,NULL,'1','402880e55c590053015c59291f6a0000',100,'public class Solution006 {\r\n    public double findMedianSortedArrays(int[] nums1, int[] nums2) {\r\n      int len_1=nums1.length;\r\n        int len_2=nums2.length;\r\n   